import React, { useRef, useState } from 'react'
import TiltText from '../components/TiltText'
import Page1Bottom from '../components/Page1Bottom'
import { useGSAP } from '@gsap/react'
import gsap from 'gsap'


const Page1 = () => {
  const titleRef = useRef(null)
  const [xVal, setXVal] = useState(0)
  const [yVal, setYVal] = useState(0)

  const mouseMoving = (e) => {
  
    // setXVal(e.clientX / 100)
    // setYVal(e.clientY / 100)
    setXVal((e.clientX - titleRef.current.getBoundingClientRect().x - titleRef.current.getBoundingClientRect().width / 2)/70)
    setYVal(-(e.clientY - titleRef.current.getBoundingClientRect().x - titleRef.current.getBoundingClientRect().width / 2)/20)
    
    titleRef.current.style.transform = `rotateX(${yVal}deg) rotateY(${xVal}deg)`
  }

  useGSAP(function(){
    gsap.to(titleRef.current, {
      transform: `rotateX(${yVal}deg) rotateY(${xVal}deg)`,
      duration:3,
      ease: "power2.out",
    })
  }, [xVal, yVal])

  return (
    <div onMouseMove={(e) =>{ mouseMoving(e) }} className='page-1 h-screen bg-amber-50 p-4'>
      
      <div id='page1-in' className=' h-full w-full bg-cover shadow-2xl shadow-gray-700     p-5 sm:p-11 bg-center rounded-[34px] 
       bg-[url("data:image/jpeg;base64,")]'
      >
      
      
        <img className='hi h-17' src="https://static.wixstatic.com/media/f1c650_e7181873180d410ba6848efd4e8cc5ef~mv2.png/v1/fill/w_88,h_70,al_c,q_85,usm_0.66_1.00_0.01,enc_avif,quality_auto/LOGO%20WHITE_edited.png" alt="" />
        
        <TiltText ref={titleRef} />
        
        <Page1Bottom />
      </div>
    </div>

  )
}

export default Page1
